import { Container} from 'react-bootstrap';
import { Navbar, Nav } from 'react-bootstrap';
import { FaFacebook, FaTwitter, FaInstagram, FaWhatsapp, FaSnapchat } from 'react-icons/fa';

function Footer() {
  return (
    <footer >
      <Container className='bg-red'>
      <Navbar bg="light" expand="lg">
      <Container>
        
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            
          </Nav>
          <Nav>
          
            <Nav.Link href="#"><FaWhatsapp /></Nav.Link>
            <Nav.Link href="#"><FaSnapchat /></Nav.Link>
            <Nav.Link href="#"><FaFacebook /></Nav.Link>
            <Nav.Link href="#"><FaTwitter /></Nav.Link>
            <Nav.Link href="#"><FaInstagram /></Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
        <hr />
        <p className="text-center">© {new Date().getFullYear()} Copyright: أكاديمية نور القرءان</p>
      </Container>
    </footer>
  );
}

export default Footer;
